"""5. What are iterators in Python and how do they differ from iterables?


    In Python, iterators and iterables are related concepts, but they serve different purposes.
    
    Let's break down each term and explain the differences:

a. Iterable

    An iterable is any object that can return an iterator.
    It is something you can loop over (e.g., using a for loop). Examples of iterables include:

    Lists
    Tuples
    Strings
    Dictionaries
    Sets
    Custom objects that implement the __iter__ method.

    Key Characteristics:

    An iterable must implement the __iter__ method, which returns an iterator.




"""

