"""b. Iterator

    An iterator is an object that represents a stream of data; it is what the __iter__ method of an iterable returns.
    
    An iterator must implement two methods:

    __iter__() → Returns the iterator object itself.
    __next__() → Returns the next value from the iterator.
    If there are no more items, it raises a StopIteration exception.

    Key Characteristics:

    Iterators are stateful—they keep track of where they are in the iteration.

    Once an iterator is exhausted, it cannot be reset (you need to create a new iterator to start over).
"""

#example
my_list = [1, 2, 3]
iterator = iter(my_list)  # Get an iterator from the list

print(next(iterator))  # Output: 1
print(next(iterator))  # Output: 2
print(next(iterator))  # Output: 3

"""6. Explain the concept of generators in Python and how they are defined.




    Generators in Python are a special way to create iterators.
    They allow you to iterate over a sequence of values without having to create and store the entire sequence in memory.
    Instead, they generate the values on the fly, one at a time, which makes them very memory efficient.

    A generator is defined like a normal function but uses the yield keyword instead of return.
    When a generator function is called, it does not run the function immediately but instead returns a generator object that can be iterated over.
How do Generators Work?

    When the generator's next() method is called (or the generator is iterated over in a loop), the function runs until it hits a yield statement.
    The yield statement pauses the function, saves its state, and outputs the value to the caller.
    The next time the generator is called, it resumes from where it paused, not from the beginning.

Why Use Generators?

    Memory Efficiency: They don’t store all the values in memory.
    Lazy Evaluation: Values are generated only when needed.
"""

# example
def count_up_to(max_value):
    current = 1
    while current <= max_value:
        yield current
        current += 1

# Create a generator object
counter = count_up_to(5)

# Use the generator
for number in counter:
    print(number)

"""7. What are the advantages of using generators over regular functions?


    Generators provide several advantages over regular functions, particularly when dealing with large datasets, infinite sequences, or when optimizing memory usage. Here's a breakdown of the advantages:


  a. Lazy Evaluation

    Generators produce values one at a time and only when requested, using the yield keyword. This lazy evaluation means they don’t compute all values upfront, saving memory and improving performance.

    Use case: Iterating over a large dataset without loading the entire dataset into memory.

  b. Memory Efficiency

    Since generators yield items one at a time, they are memory-efficient compared to functions that return lists or other collections, which require the entire dataset to be stored in memory.

    Example: A generator can produce numbers in a range without allocating a large list.

    def range_generator(n):
        for i in range(n):
            yield i

  c. Support for Infinite Sequences

    Generators can represent infinite sequences because they don’t store values in memory. Regular functions would need to define an upper limit or consume excessive memory.

    Example: Generating Fibonacci numbers indefinitely:

    def fibonacci():
        a, b = 0, 1
          while True:
              yield a
              a, b = b, a + b

  d. Improved Performance

    Generators pause their state after yielding a value, resuming execution where they left off.
    
    This is faster and more efficient for iterative computations compared to repeatedly calling a function.

  e. Simplified Code for Iterative Tasks

    Generators simplify code that involves iterating over large datasets or sequences.
    
    Instead of manually managing indices or chunks of data, the generator's yield takes care of it.

  f. Pipelines and Composability

    Generators can be easily chained or composed to process data in stages, forming pipelines.
    
    Each generator can perform a transformation step and pass the result to the next.

    Example:

    def read_lines(file):
        for line in file:
            yield line.strip()

    def filter_lines(lines, keyword):
        for line in lines:
            if keyword in line:
                yield line

    # Chain generators:
    with open('file.txt') as f:
        lines = read_lines(f)
        filtered = filter_lines(lines, 'important')
            for line in filtered:
            print(line)

  g. Enhanced Iterative Control

    Generators give fine-grained control over iteration.
    
    They can maintain their state between calls, making them more flexible for tasks like backtracking or partial computation.

  h. Reduced Overhead for Iterators

    Generators automatically implement the iterator protocol (__iter__ and __next__ methods).
    
    This makes them easier to use than writing custom iterator classes manually.

    Example: Instead of creating a class with __next__ and __iter__, you can write a generator in a few lines.
"""

#Example
def simple_generator(n):
    for i in range(n):
        yield i

# Using the generator:
gen = simple_generator(5)
for num in gen:
    print(num)

def even_numbers(numbers):
    for number in numbers:
        if number % 2 == 0:
            yield number

# Using the generator:
nums = [1, 2, 3, 4, 5, 6]
evens = even_numbers(nums)
for even in evens:
    print(even)

"""8. What is a lambda function in Python and when is it typically used?


    A lambda function in Python is a small, anonymous function defined using the lambda keyword.
    
    It is sometimes referred to as an inline function because it is often used for short, simple operations without formally defining a full function using the def keyword.


  Syntax:

    lambda arguments: expression

    arguments: A comma-separated list of parameters the function takes.

    expression: A single expression that the function evaluates and returns.

 Characteristics:

    Lambda functions can have any number of arguments but only a single expression.

    They return the value of the expression automatically (no need for an explicit return statement).

    Typically used for short, simple functions.


  Limitations:

    Limited to a single expression (cannot include multiple statements or assignments).

    Less readable for complex operations compared to regular functions.
    
    Debugging can be harder since lambdas are anonymous (no function name in error traces).
"""

# A lambda function to add 10 to a number
add_10 = lambda x: x + 10
print(add_10(5))  # Output: 15

# A lambda function to multiply two numbers
multiply = lambda x, y: x * y
print(multiply(3, 4))  # Output: 12

"""Common Use Cases:

    a.
    As arguments to higher-order functions: Lambda functions are   frequently passed as arguments to functions like map(), filter(), and sorted().
"""

# Using lambda with map to square a list of numbers
numbers = [1, 2, 3, 4]
squared = map(lambda x: x**2, numbers)
print(list(squared))  # Output: [1, 4, 9, 16]

