"""9.  Explain the purpose and usage of the `map()` function in Python.


    The map() function in Python is used to apply a function to every item in an iterable (like a list, tuple, etc.) and return a map object (which is an iterator).

    You can think of it as a way to transform or change each element in a collection using a given function.

Syntax:

    map(function, iterable)

    function: This is the function that you want to apply to each item in the iterable.
    
    iterable: This can be a list, tuple, or any collection you want to process.
"""

# Function to square a number
