"""10.  What is the difference between `map()`, `reduce()`, and `filter()` functions in Python?



    The map(), reduce(), and filter() functions are built-in functions in Python that allow you to perform operations on sequences (like lists or tuples).
    
    Here’s a simple explanation of each, with an example:

a. map() function:

    Purpose: It applies a given function to all the items in an iterable (like a list) and returns a map object (which is an iterator).

    How it works: You pass a function and an iterable to map(). It applies the function to each item of the iterable.
"""

numbers = [1, 2, 3, 4]
squared_numbers = map(lambda x: x ** 2, numbers)
print(list(squared_numbers))

"""b.  filter() function:

    Purpose: It filters the elements of an iterable based on a function that returns either True or False (i.e., a condition).
     
    It returns a filter object (which is an iterator) containing only the elements that satisfy the condition.

    How it works: You pass a function and an iterable to filter(). The function checks each item, and filter() only returns items for which the function returns True.
"""

numbers = [1, 2, 3, 4, 5, 6]
even_numbers = filter(lambda x: x % 2 == 0, numbers)
print(list(even_numbers))

"""c.  reduce() function:

    Purpose: It performs a cumulative operation on the elements of an iterable, reducing them to a single value.

    Unlike map() and filter(), reduce() doesn’t return an iterable; it returns a single value.

    How it works: You pass a function and an iterable to reduce(). The function takes two elements at a time and reduces them to one value.
    
    This process continues until all elements are processed.
"""

from functools import reduce
numbers = [1, 2, 3, 4]
sum_of_numbers = reduce(lambda x, y: x + y, numbers)
print(sum_of_numbers)

